import React, { createContext, useCallback, useState } from 'react';
// import ComA from './comA';


// const FatherName = createContext();
// const LastName = createContext();

const App = () => {

   const [num, setNum] = useState(0);
   const [nums, setNums] = useState(0);
   return (
      <>
 
      <button className="b1"
       onClick={ () => {
          setNum(num+1);
       }}
       ></button>
       <br/>
       <button 
       onClick={ () => {
          setNums(nums+1);
       }}
       ></button>

   </>
   );
};

export default App;
